class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
    ###############################################
        if s == "":
            return True

        if t == "":
            return False

        idxList = []
        idx = 0
        for i in s:
            if t[idx] == i:
                idxList.append(idx)
                idx += 1
                break
        if len(idxList) == len(s):
            return self.isSortedList(idxList)
        else:
            return False

