    def isSortedList(self, strIdxList):
        # strIdxList = strIdxList
        i = 0
        while i < len(strIdxList) - 1:
            if strIdxList[i + 1] > strIdxList[i]:
                i += 1
            else:
                break
        if i == len(strIdxList) - 1:
            return True
        else:
            return False





